  },
  watch: {
    channel(data) {
      if (data) {
        this.drawChart();
      }
    },
    isLunbo() {
      this.showTip();
      this.startAction();
    }
  },
  methods: {
    initChart(name, el) {
      this[name] = this.$echarts.init(this.$refs[el], "dark");
      this[name].showLoading({
        text: "加载中...",
        maskColor: "rgba(0, 0, 0, 0.3)",
        textColor: "#fff"
      });
    },
    drawChart() {
      let usersList = Object.values(this.channel).map(value => {
        return value.startcount;
      });

      let usersStartList = Object.values(this.channel).map(value => {
        return -value.startTimescount;
      });
      
      if(usersList.length>8){
        usersList = usersList.slice(0,9);
      }
      if(usersStartList.length>8){
        usersStartList = usersStartList.slice(0,9);
      }
      let option = {
        tooltip: {
          trigger: "axis",
          axisPointer: {
            type: "shadow"
          },
          textStyle: {
            fontSize: 6
          },
          formatter(param) {
            let str = param[0].axisValue + "<br/>";
            for (let i = 0; i < param.length; i++) {
              str +=
                param[i].marker +
                param[i].seriesName +
                "：" +
                Math.abs(param[i].data) +
                "<br/>";
            }
            return str;
          }
        },
        grid: {
          left: "2%",
          right: "13%",
          bottom: "-10%",
          top: "12%",
          containLabel: true
        },
        legend: {
          data: ["启动次数", "启动用户数"],
          itemWidth: 6,
          itemHeight: 6,
          textStyle: {
            fontSize: 6
          },
          x: "right",
          top: 0
        },
        yAxis: [
          {
            type: "category",
            scale: true,
            data: Object.keys(this.channel),
            offset:30,
             splitLine: {
                show: false
              },
              axisLine: {
                show: true
              },
              axisTick: {
                show: false
              },
            axisLabel: {
              formatter: function(value) {
                if(value.match(/\s/g)){
                  let valuea = value.replace(/\s/g,"");
                  return "{value|" + value +"}{" + valuea + "|}";
                  // return "{" + valuea + "| }{value|" + value + "}";
                }else{
                  // return "{" + value + "| }{value|" + value + "}";
                  return "{value|" + value +"}{" + value + "|}";
                }
              },
              margin: 20,
              width:60,
              rich: {
                value: {
                  interval: 0,
                  lineHeight: 10,
                  fontSize:6,
                  width:30,
                  align: "left",
                  color:"#d3e0fa",
                  padding:[0,0,0,64]
                },
                baidu: {
                  width: 8,
                  height:8,
                  // margin:[-8,-8,-8,-8],
                  align: "right",
                  backgroundColor: {
                    image: './static/img/baidu.svg'
                  }
                },
                'APPstore':{
                  // width: 10,
                  align: "right",
                  height:8,
                  backgroundColor: {
                    image: './static/img/appStore.svg'
                  }
                },
                 'oppo':{
                  width: 20,
                  height:4,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/oppo.svg'
                  }
                },
                 'huawei':{
                  width: 8,
                  height:8,

                  align: "right",
                  backgroundColor: {
                    image: './static/img/huawei.svg'
                  }
                },
                'samsung':{
                  width: 20,
                  height:8,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/samsung.svg'
                  }
                },
                 'xiaomi':{
                  width: 8,
                  height:6,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/xiaomi.svg'
                  }
                },
                'sanliuling':{
                  width: 8,
                  height:6,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/sanliuling.svg'
                  }
                },
                 'honor':{
                  width: 30,
                  height:20,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/honor.svg'
                  }
                },
                 'vivo':{
                  width: 16,
                  height:6,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/vivo.svg'
                  }
                },
                 'yingyongbao':{
                  width: 8,
                  height:8,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/yingyongbao.svg'
                  }
                },
                'ppzhushou':{
                  width: 8,
                  height:8,
                  align: "right",
                  backgroundColor: {
                    image: './static/img/ppzhushou.svg'
                  }
                },
              },
              interval:0
            }
          }
        ],
        xAxis: [
          {
            type: "value",
            show: false
          }
        ],
        series: [
          {
            name: "启动用户数",
            type: "pictorialBar",
            symbol:
              "image://data:image/png;base64,",
            barWidth: "50%",
            data: usersList,
            label: {
              show: true,
              position: "right",
              color: "#00e0f4",
              fontSize: 8,
              formatter: function(param) {
                if (param.value !== 0) {
                  return param.value;
                } else {
                  return "";
                }
              },
              emphasis: {
                color: "#f0515e"
              }
            }
          },
          {
            name: "启动次数",
            type: "pictorialBar",
            symbol:
              "image://data:image/png;base64,",
            data: usersStartList,
            barWidth: "50%",
            label: {
              show: true,
              position: "left",
              color: "#a98931",
              fontSize: 8,
              formatter: function(param) {
                if (param.value !== 0) {
                  return -param.value;
                } else {
                  return "";
                }
              },
              emphasis: {
                color: "#f0515e"
              }
            }
          }
        ]
      };

      this.qudaoChart.setOption(option);
      this.qudaoChart.hideLoading();
    },
    showTip() {
      if (this.isLunbo &&  Object.keys(this.channel).length > 1) {
        if (this.indexItem >= Object.keys(this.channel).length) {
          this.indexItem = 0;
        }
        this.qudaoChart.dispatchAction({
          type: "showTip",
          seriesIndex: 0,
          dataIndex: this.indexItem
        });
        this.indexItem++;
      }
    },
    startAction() {
      if (this.timer) {
        clearInterval(this.timer);
      }
      if (this.isLunbo) {
        this.timer = setInterval(() => {
          this.showTip();
        }, this.lbTime);
      } else {
        clearInterval(this.timer);
        this.timer = null;
      }
    }
  },
  mounted() {
    this.initChart("qudaoChart", "qudaoDom");
    if (this.channel) {
      this.drawChart();
      this.startAction();
      this.showTip();
    }

    this.$er.listenTo(this.$refs.qudaoDom, el => {
      let height = el.offsetHeight;
      let width = el.offsetWidth;
      this.$nextTick(() => {
        this.qudaoChart.resize({ width: width, height: height });
      });
    });
  },
  beforeDestroy() {}
};
</script>


